import {makeStyles} from '@material-ui/core/styles'


export const useStyles = makeStyles((theme) => ({
    root: {
        backgroundColor: theme.palette.primary.white,
        borderBottom: `1px solid ${theme.palette.primary.gray}`,
        '& ':{}
    }
}));
